import React, { Component } from 'react'
import { BrowserRouter as Router, Route } from 'react-router-dom';
import SignupForm from './SignupForm'
import LoginForm from './LoginForm'
import Navbar from '../components/Navbar'
import NewPostForm from './NewPostForm'
import Timeline from '../components/Timeline'

// signup={signup} 
// login={login} 
// loggedIn={loggedIn} 
// loggedInAs={loggedInAs} 
// posts={posts} 
// onSignUp={this.signUp}
// onLogin={this.login}
// onLoggedIn={this.loggedIn}
// onSetCurrentUser={this.setCurrentUser}

export class Home extends Component {
    render() {
        let { signup, login, loggedIn, loggedInAs, posts, onSignUp, onLogin, onLoggedIn, onSetCurrentUser } = this.props
        return (
            <div>
                HELLO, YOU ARE AT HOME PAGE<br />
                <Router>
                    <Navbar onSignUp={onSignUp} onLogin={onLogin} loggedIn={loggedIn} />
                    <Route exact path="/signup" render={() => <SignupForm onSetCurrentUser={this.setCurrentUser} onsignUp={this.signUp} loggedIn={this.loggedIn} signup={this.state.signup} />} />
                    <Route exact path="/login" render={() => <LoginForm onSetCurrentUser={this.setCurrentUser} onLoggedIn={this.loggedIn} login={this.state.login} onLogin={this.login} />} />
                    <Route exact path="/post/new" render={() => <NewPostForm />} />
                    <Route exact path="/timeline" render={() => <Timeline />} />
                </Router>
            </div>
        )
    }
}

export default Home
